    <p>{`可设置最大上传文件数量的组件，通常，在 `}<strong parentName="p">{`上传头像`}</strong>{` 时，这个组件很有用。`}</p>
    <h3 {...{
      "id": "主要做了以下工作"
    }}>{`主要做了以下工作`}</h3>
